import React from 'react';

class Search_box extends React.Component {
  render() {
    return(
        <div id="search">
        <form name="sform" action="{{ url_for('main.search_index') }}" method="get">
            <select name="option" id="option">
                <option value="1" class="opt">통합검색</option>
                <option value="2" class="opt">민법</option>
                <option value="3" class="opt">판례</option>
            </select>
            <input id="query" name="query" type="text" placeholder="검색어를 입력해 주세요"></input>
            <button id="icon" type="submit"><i class="bi bi-search"></i></button>
        </form>
        </div>
    )
  }
}

export default Search_box
